insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (1, '짭조름한 일본', '한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다. 군인은 현역을 면한 후가 아니면 국무총리로 임명될 수 없다.', 25000, 400, 183, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (2, '씁쓰름한 수단', '국군의 조직과 편성은 법률로 정한다. 의무교육은 무상으로 한다. 여자의 근로는 특별한 보호를 받으며, 고용·임금 및 근로조건에 있어서 부당한 차별을 받지 아니한다.', 5000, 140, 81, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (3, '짭짤한 사하라 아랍 민주 공화국', '신체장애자 및 질병·노령 기타의 사유로 생활능력이 없는 국민은 법률이 정하는 바에 의하여 국가의 보호를 받는다. 국무총리는 대통령을 보좌하며, 행정에 관하여 대통령의 명을 받아 행', 31000, 240, 87, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (4, '시큼한 나이지리아', '대통령은 국가의 원수이며, 외국에 대하여 국가를 대표한다. 재판의 전심절차로서 행정심판을 할 수 있다. 행정심판의 절차는 법률로 정하되, 사법절차가 준용되어야 한다.', 50000, 100, 20, false);
insert into product (project_id, title, description, price, quantity_supplied, quantity_remained, deleted) values (1, '개운한 페루', '언론·출판에 대한 허가나 검열과 집회·결사에 대한 허가는 인정되지 아니한다. 국가는 사회보장·사회복지의 증진에 노력할 의무를 진다. 국회의원의 수는 법률로 정하되, 200인 이상으', 8000, 330, 149, false);